import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getClos } from "../../actions/clos";
import { Form } from "reactstrap";
import { Dropdown } from "semantic-ui-react";
export class Mapping extends Component {
  static propTypes = {
    clos: PropTypes.array.isRequired,
    getClos: PropTypes.func.isRequired
  };
  //component load then
  componentDidMount() {
    this.props.getClos();
  }
  render() {
    return (
      <Fragment>
        <Dropdown
          placeholder="Select Friend"
          fluid
          selection
          options={this.props.clos.map(clo => (
            <tr key={clo.id}>
              <td>{clo.code}</td>

              <td></td>
            </tr>
          ))}
        />
        <h2>Course Learning Outcomes</h2>
        <table className="table table-stripped">
          <thead>
            <tr>
              <th>CODE</th>
              <th />
            </tr>
          </thead>

          <tbody>
            {this.props.clos.map(clo => (
              <tr key={clo.id}>
                <td>{clo.code}</td>

                <td></td>
              </tr>
            ))}
          </tbody>
        </table>
      </Fragment>
    );
  }
}

//state of redux
const mapStateToProps = state => ({
  clos: state.clos.clos
});
export default connect(mapStateToProps, { getClos })(Mapping);
